    false,nt"url": null,nt"notes": " This layer represents boundaries for New
    Mexico tax district "OUT" categories andnincorporated/municipal "IN" categories
    as identified on the "Certificate of Tax Rates" published forneach of the State's
    thirty-three counties by the Department of Finance and Administration's Budgetnand
    Finance Bureau. Initial municipal boundaries acquired from RGIS and based on layers
    developed bynthe Earth Data Analysis Center (EDAC) at UNM. TRD revisions have been
    made by acquiring updatednboundaries from data stewards at local jurisdictions.
    Data is a vector polygon digital datanstructure taken from the Census Bureau's TIGER/Line
    Files, 1994, for New Mexico. Known issues: Thisndata layer may contain unintended
